import React from 'react'

const Booklist = (props) => {

	return (
		<div>
			<h3>Your books</h3>
    		<ul>
				{props.books.map((book) => 
    			<Book name={book.name} readPages={book.pagesRead} pages={book.pages} />
    			)}
    		</ul>
		</div>
	);
}

const Book = (props) => {

	return (
		<li><b>{props.name}</b> Completion: <b>{100*props.readPages/props.pages}%</b></li>
	)
}

export default Booklist
